SET FOREIGN_KEY_CHECKS=0;

CREATE DATABASE `opalaclu_bd`
    CHARACTER SET 'latin1'
    COLLATE 'latin1_swedish_ci';

USE `opalaclu_bd`;

#
# Structure for the `cad_enquete` table : 
#

CREATE TABLE `cad_enquete` (
  `numero` int(11) NOT NULL auto_increment COMMENT 'Numero da enquete',
  `pergunta` varchar(50) default NULL COMMENT 'Pergunta da enquete',
  `datainicio` datetime default NULL COMMENT 'Data de inicio da enquete',
  `datafim` datetime default NULL COMMENT 'Data fim data enquete',
  `tiporesposta` char(1) default NULL COMMENT 'Status da enquete P=pendente,I=iniciada,F=finalizada',
  PRIMARY KEY  (`numero`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

#
# Structure for the `cad_enquete_opcoes` table : 
#

CREATE TABLE `cad_enquete_opcoes` (
  `numero` int(11) NOT NULL default '0' COMMENT 'Numero da enquete',
  `opcao` int(11) NOT NULL default '0' COMMENT 'Numero da op??o',
  `texto` varchar(40) default NULL COMMENT 'Texto descritivo da op??o',
  PRIMARY KEY  (`numero`,`opcao`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

#
# Structure for the `cad_enquete_votos` table : 
#

CREATE TABLE `cad_enquete_votos` (
  `numero` int(11) NOT NULL default '0' COMMENT 'Numero da enquete votada',
  `opcao` int(11) NOT NULL default '0' COMMENT 'Op??o escolhida',
  `voto` int(11) NOT NULL auto_increment COMMENT 'Numero sequencial do voto',
  `ip` varchar(32) default NULL COMMENT 'IP do cliente que votou',
  `datahora` datetime default NULL COMMENT 'Data e hora do voto',
  `userid` int(11) default NULL COMMENT 'Codigo do usu?rio que votou qdo estiver logado',
  PRIMARY KEY  (`voto`),
  KEY `numero` (`numero`,`ip`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;

#
# Structure for the `cad_eventos` table : 
#

CREATE TABLE `cad_eventos` (
  `id` int(11) NOT NULL auto_increment COMMENT 'Código do evento',
  `data` date default NULL COMMENT 'Data do evento',
  `local` varchar(60) default NULL COMMENT 'local do evento',
  `descricao` longtext COMMENT 'Descricao do evento',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# Structure for the `cad_fotos_usuarios` table : 
#

CREATE TABLE `cad_fotos_usuarios` (
  `userid` int(8) NOT NULL default '0' COMMENT 'codigo do usuario',
  `foto` int(6) NOT NULL default '0' COMMENT 'numero da foto',
  `arquivo` varchar(60) default NULL COMMENT 'caminho do arquivo das fotos do usuario',
  `datainclusao` date default NULL,
  PRIMARY KEY  (`userid`,`foto`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

#
# Structure for the `cad_mural` table : 
#

CREATE TABLE `cad_mural` (
  `codigo` int(10) unsigned NOT NULL auto_increment COMMENT 'Numero sequencial da mensagem',
  `datahora` datetime NOT NULL default '0000-00-00 00:00:00' COMMENT 'Data e Hora da inclusao da mensagem',
  `mensagem` longtext NOT NULL COMMENT 'Texto da mensagem',
  `userid` int(8) unsigned NOT NULL default '0' COMMENT 'Usuario que postou',
  PRIMARY KEY  (`codigo`)
) ENGINE=MyISAM AUTO_INCREMENT=167 DEFAULT CHARSET=latin1 COMMENT='Mensagens do Mural';

#
# Structure for the `cad_noticias` table : 
#

CREATE TABLE `cad_noticias` (
  `codigo` int(11) NOT NULL auto_increment COMMENT 'C?digo da noticia',
  `titulo` varchar(60) NOT NULL default '' COMMENT 'T?tulo da noticia',
  `datahora` datetime NOT NULL default '0000-00-00 00:00:00' COMMENT 'Data e hora da noticia',
  `noticia` longtext NOT NULL COMMENT 'Corpo da noticia',
  `userid` int(8) NOT NULL default '0' COMMENT 'Usuario que registrou a noticia',
  PRIMARY KEY  (`codigo`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=latin1 COMMENT='Cadastro de ?ltimas noticias';

#
# Structure for the `cad_param` table : 
#

CREATE TABLE `cad_param` (
  `codigo` int(10) unsigned NOT NULL auto_increment COMMENT 'Codigo do registro',
  `emailadm` varchar(90) default NULL COMMENT 'Email do administrador do site',
  `emailwbm` varchar(90) default NULL COMMENT 'Email do webmaster',
  PRIMARY KEY  (`codigo`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COMMENT='Cadastro de parâmetros';

#
# Structure for the `cad_usuario` table : 
#

CREATE TABLE `cad_usuario` (
  `username` varchar(20) NOT NULL default '' COMMENT 'nick name do usuário\n',
  `senha` tinytext NOT NULL COMMENT 'Password do usuário',
  `Nome` varchar(40) NOT NULL default '' COMMENT 'Nome completo do usuário',
  `Endereco` varchar(40) default NULL COMMENT 'Endereço residencial',
  `Numero` int(5) default NULL COMMENT 'Número da residência',
  `Cidade` varchar(40) default NULL COMMENT 'Cidade',
  `Estado` char(2) default NULL COMMENT 'Estado',
  `Cep` int(8) default NULL COMMENT 'Cep residencial',
  `DDD` int(6) default NULL COMMENT 'DDD',
  `Fone` int(10) default NULL COMMENT 'Fone de contato',
  `DDDCel` int(6) default NULL COMMENT 'DDD do Celular',
  `Celular` int(10) default NULL COMMENT 'Número do Celular',
  `EMail` varchar(90) NOT NULL default '' COMMENT 'E-mail',
  `DataNasc` date default NULL COMMENT 'Data de Nascimento',
  `Nivel` int(8) default '0' COMMENT 'Nivel 1=usuário normal 999999=administrador',
  `userid` int(8) NOT NULL auto_increment COMMENT 'Código do usuário',
  `flpublica` char(1) default 'S' COMMENT '"S" = publica dados   "N" = Não publica',
  `flconfirma` char(1) default 'S' COMMENT '"S" = Cadastro confirmado "N" = Não Confirmado',
  `dtcadastro` datetime default NULL COMMENT 'Data de cadastramento',
  `possuiopala` char(1) default 'N' COMMENT 'S/N possui um opala',
  `descricao` longtext COMMENT 'Descri?ao do opala',
  `anopala` int(4) default '0' COMMENT 'Ano do opala',
  PRIMARY KEY  (`userid`)
) ENGINE=MyISAM AUTO_INCREMENT=45 DEFAULT CHARSET=latin1 COMMENT='cadastro de usuários do bolão';

#
# Structure for the `log_bolao` table : 
#

CREATE TABLE `log_bolao` (
  `sequencia` int(10) unsigned NOT NULL auto_increment COMMENT 'Numero de Sequencia de registros',
  `datahora` datetime NOT NULL default '0000-00-00 00:00:00' COMMENT 'Data e Hora do registro',
  `userid` int(8) unsigned NOT NULL default '0' COMMENT 'Usuario que executou o acesso',
  `strsql` mediumtext NOT NULL COMMENT 'Instru?ao sql executada',
  `programa` varchar(20) NOT NULL default '' COMMENT 'Nome do programa que originou a instru?ao',
  PRIMARY KEY  (`sequencia`)
) ENGINE=MyISAM AUTO_INCREMENT=310 DEFAULT CHARSET=latin1 COMMENT='LOG DE ACESSO AO BANCO DE DADOS';

#
# Structure for the `log_usuario` table : 
#

CREATE TABLE `log_usuario` (
  `sequencia` int(10) unsigned NOT NULL auto_increment COMMENT 'Numero de sequencia',
  `userid` int(8) unsigned NOT NULL default '0' COMMENT 'codigo de usuario',
  `datahora` datetime NOT NULL default '0000-00-00 00:00:00' COMMENT 'Data e Hora do acesso',
  PRIMARY KEY  (`sequencia`)
) ENGINE=MyISAM AUTO_INCREMENT=310 DEFAULT CHARSET=latin1 COMMENT='log de acesso dos usuarios';

#
# Structure for the `usr_online` table : 
#

CREATE TABLE `usr_online` (
  `ID` bigint(20) unsigned NOT NULL auto_increment,
  `sessao` varchar(50) NOT NULL default '' COMMENT 'Session id',
  `userid` int(8) unsigned NOT NULL default '0' COMMENT 'Codigo de usuario',
  `datetime` bigint(20) unsigned NOT NULL default '0' COMMENT 'Data e hora do ultimo acesso',
  PRIMARY KEY  (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=310 DEFAULT CHARSET=latin1 COMMENT='Usuários online';

